import React from 'react';
import ScreeningInfoComponent from './ScreeningInfoComponent'; // Import your ScreeningInfoComponent here

function App() {
  return (
      <div className="App">
        <header className="App-header">
          <h1>Welcome to HRK's Cinema</h1>
        </header>
        <main className = "landing-page">
            <div className = "login-options">
                <h2> Login </h2>
                <button className = "google-login"> Login with Google </button>
                <p className = "description"> This will allow you to access your booking history and preferences. </p>
            </div>
            <div className="login-option">
                <button className="guest-login"> Continue as guest </button>
                <p className="description"> No login required. </p>
            </div>
            <ScreeningInfoComponent/> {/* Render your ScreeningInfoComponent here */}
        </main>
      </div>
  );
}

export default App;
